DROP TABLE IF EXISTS cishfid.jurisdiction;

DROP SEQUENCE IF EXISTS cishfid.jurisdiction_id_seq;

CREATE SEQUENCE IF NOT EXISTS cishfid.jurisdiction_id_seq
    INCREMENT 1
    START 1
    MINVALUE 1
    MAXVALUE 9223372036854775807
    CACHE 250;

create table cishfid.jurisdiction
(
    id bigint NOT NULL,
    stm_tp_cd            text,
    src_tbl_no           integer,
    src_tbl_nme          text,
    src_cat              text,
    jrsdctn_src_tp_cd    text,
    jrsdctn_src_tp_desc  text,
    tbl_nme              text,
    jurisdiction_id      integer,
    comp_tp_cd           integer,
    cntry_cd             text,
    jurisdiction_tp_desc text,
    eff_dt               text,
    exp_dte              text,
    CONSTRAINT jurisdiction_pkey PRIMARY KEY(id)
);

commit;